import React from 'react';
import {PAGES} from '../constants';

class Menu extends React.Component {

    render() {
        return (<div className="options">
                    <p onClick={() => this.props.menuSelection(PAGES.WEDDING)}>Wedding</p>
                    <p onClick={() => this.props.menuSelection(PAGES.TRAVEL)}>Travel</p>
                    <p onClick={() => this.props.menuSelection(PAGES.RSVP)}>RSVP</p>
                </div>);
    }
}

export default Menu;
